func main() {
	for i, strings := range s {
		spaces := replaceSpaces(strings[0].(string), strings[1].(int))
		log.Println(i, spaces)
	}
}
func replaceSpaces(S string, length int) string {
	// 有几个空格
	num := 0
	for i := 0; i < length; i++ {
		if S[i] == ' ' {
			num++
		}
	}
	// 创建二进制切片 大小为字符串+空格数 3字节
	result := make([]byte, 3*num+(length-num))
	// 插入切片的下标
	k := 0
	for i := 0; i < length; i++ {
		// 如果遇到空格 在k处插入% 2 0各占三个切片下标
		if S[i] == ' ' {
			result[k] = '%'
			result[k+1] = '2'
			result[k+2] = '0'
			// 修复下标
			k += 3
		} else {
			// 插入原字符
			result[k] = S[i]
			k++
		}
	}
	// 二进制转字符串
	return string(result)
}
